CREATE PROCEDURE UDP_INSERT_NEW_QUESTION	@bookName NVARCHAR(200),
											@page INT,
											@questionNumber INT,
											@authorID INT,
											@content NVARCHAR(MAX), 
											@picture NVARCHAR(200), 
											@rank INT,
											@classID INT
AS


/********************8

SELECT *
FROM [QuestionsAndClasses]

SELECT *
FROM [Questions]


EXEC UDP_INSERT_NEW_QUESTION 
		'גאומטריה בני גורן',
		1212,
		5,
		1,
		'ניסיון 100',
		'',
		2,
		2,
		1

***************************/
INSERT INTO [Questions] ( bookName, page, questionNumber, authorID, content, picture, rank)
VALUES ( @bookName, @page, @questionNumber, @authorID, @content, @picture, @rank);
DECLARE @question_id as int
SET @question_id = (SELECT TOP 1 SCOPE_IDENTITY())
INSERT INTO [QuestionsAndClasses] (classID, questionID)

VALUES (@classID,@question_id);